import React, { useState, useEffect } from 'react';
import { FiFilm, FiHeart, FiMail, FiCalendar } from 'react-icons/fi';

const Profile = () => {
  const [stats, setStats] = useState({ moviesCount: 0, favoritesCount: 0 });
  const username = localStorage.getItem('username') || 'User';
  const joinDate = new Date().toLocaleDateString('en-US', { 
    year: 'numeric', 
    month: 'long' 
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        console.log('Fetching stats with token:', localStorage.getItem('token'));
        const response = await fetch('/api/movies/stats', {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          }
        });
        const data = await response.json();
        console.log('Stats received in frontend:', data);
        setStats(data);
      } catch (error) {
        console.error('Error fetching stats:', error);
      }
    };

    fetchStats();
  }, []);

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-gray-800 to-black">
      <div className="container mx-auto px-4 py-12">
        <div className="max-w-4xl mx-auto">
          {/* Profile Header */}
          <div className="bg-gray-800/50 backdrop-blur-sm rounded-2xl p-8 shadow-xl border border-gray-700/50">
            <div className="flex flex-col md:flex-row items-center gap-8 mb-8">
              <img
                src={`https://ui-avatars.com/api/?name=${username}&background=random&size=128`}
                alt="Profile"
                className="w-32 h-32 rounded-full ring-4 ring-blue-500/50 shadow-xl"
              />
              <div className="text-center md:text-left">
                <h1 className="text-4xl font-bold text-white mb-2">{username}</h1>
                <div className="flex flex-col md:flex-row gap-4 text-gray-400">
                  <div className="flex items-center gap-2">
                    <FiMail className="w-4 h-4" />
                    <span>user@example.com</span>
                  </div>
                  <div className="flex items-center gap-2">
                    <FiCalendar className="w-4 h-4" />
                    <span>Joined {joinDate}</span>
                  </div>
                </div>
              </div>
            </div>

            {/* Stats Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="bg-gray-700/30 rounded-xl p-6 border border-gray-700/50">
                <div className="flex items-center gap-4 mb-4">
                  <div className="p-3 bg-blue-500/10 rounded-lg">
                    <FiFilm className="w-6 h-6 text-blue-400" />
                  </div>
                  <div>
                    <h3 className="text-lg font-medium text-gray-300">Movies Added</h3>
                    <p className="text-4xl font-bold text-blue-400">{stats.moviesCount}</p>
                  </div>
                </div>
                <div className="h-2 bg-gray-700/50 rounded-full overflow-hidden">
                  <div 
                    className="h-full bg-blue-500 rounded-full"
                    style={{ width: `${(stats.moviesCount / 20) * 100}%` }}
                  />
                </div>
              </div>

              <div className="bg-gray-700/30 rounded-xl p-6 border border-gray-700/50">
                <div className="flex items-center gap-4 mb-4">
                  <div className="p-3 bg-purple-500/10 rounded-lg">
                    <FiHeart className="w-6 h-6 text-purple-400" />
                  </div>
                  <div>
                    <h3 className="text-lg font-medium text-gray-300">Favorites</h3>
                    <p className="text-4xl font-bold text-purple-400">{stats.favoritesCount}</p>
                  </div>
                </div>
                <div className="h-2 bg-gray-700/50 rounded-full overflow-hidden">
                  <div 
                    className="h-full bg-purple-500 rounded-full"
                    style={{ width: `${(stats.favoritesCount / 20) * 100}%` }}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
